import { GridRenderCellParams } from '@mui/x-data-grid';

export const COLUMNS = [
  {
    field: 'id',
    headerName: 'ID',
    width: 100,
    renderCell: (params: GridRenderCellParams<any>) =>
      `<div>${params.value('id')}</div>`,
  },
  {
    field: 'first_name',
    headerName: 'First Name',
    width: 200,
  },
  {
    field: 'last_name',
    headerName: 'Last Name',
    width: 200,
  },
  {
    field: 'email',
    headerName: 'Email',
    width: 200,
  },
  {
    field: 'sex',
    headerName: 'Sex',
    width: 100,
  },
  {
    field: 'created_at',
    headerName: 'Creation Date',
    width: 200,
  },
];
